import React, { useRef } from "react";
import { FaBars, FaTimes } from "react-icons/fa";

function Navbar() {
  const nav = useRef();
  const logo = useRef();

  const showNavbar = () => {
    nav.current.classList.toggle("responsive_nav");
  };
  return (
    <div>
      <div className="container" id="container">
        <header>
        <img
          ref={nav}
          className="doglogo push"
          src="/doglogo.png"
          alt="logo"
        ></img>
        <button className="loginn hide_button">Login</button>
        <button className="signupp hide_button">Sign Up</button>

        <button className="hide_button" onClick={showNavbar}><FaBars /></button>
        </header>
      </div>
    </div>
  );
}

export default Navbar;
